(27, 'Bạn cần biết', 'ban-can-biet', 'sdfs', '<figure class=\"image\"><img alt=\"cai quan gi vay\" src=\"http://lilishop2.local/storage/app/uploads/2017/11/30 - cai quan gi vay.jpg\" width=\"550\" />\r\n<figcaption>đi&ecirc;n hả m&agrave;y</figcaption>\r\n</figure>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<figure class=\"image\"><img alt=\"Takeuchi Matsuri Rokugo\" src=\"http://lilishop2.local/storage/app/uploads/2017/11/806 - Takeuchi Matsuri Rokugo.jpg\" width=\"550\" />\r\n<figcaption>ai m&agrave; biết</figcaption>\r\n</figure>\r\n\r\n<p>kh&ocirc;ng beiets đ&acirc;u sdf s sf&nbsp; hfgh fh&nbsp;</p>\r\n\r\n<p>fgh fh&nbsp;</p>\r\n\r\n<figure class=\"image\"><img alt=\"Takeuchi Matsuri Rokugo\" src=\"http://lilishop2.local/storage/app/uploads/2017/11/806 - Takeuchi Matsuri Rokugo.jpg\" width=\"550\" />\r\n<figcaption>dsf sdfs</figcaption>\r\n</figure>', '', 1, NULL, NULL, NULL, 'chinhsach', 38, NULL, '2017-11-18 21:12:36', 42, NULL),
