(40, 'Hướng dẫn mua hàng tại LiliShop.Vn', 'huong-dan-mua-hang-tai-lilishopvn', 'Để hỗ trợ việc mua hàng cho quý khách hàng được dễ dàng hơn, đây là những thông tin cần thiết và các bước để mua hàng tại lilishop.vn mời quý khách tham khảo.', '<p><span style=\"font-size:14px;\"><u><span style=\"color:#000080;\">I. <strong>HƯỚNG DẪN MUA HÀNG:</strong></span></u></span></p>\r\n\r\n<p><span style=\"color:#000080;\"><span style=\"font-size:14px;\"><strong>Hiện tại lilishop.vn có hổ trợ 3 hình thức mua hàng.</strong></span></span></p>\r\n\r\n<p><em><u><span style=\"color:#000080;\"><strong><span style=\"font-size:14px;\">#1. Bạn có thế đên trực tiếp Lilishop.vn.</span></strong></span></u></em></p>\r\n\r\n<p><span style=\"font-size:14px;\">Chúng Tôi để xem hàng và mua. Chúng Tôi có hơn hàng trăm mẫu cho bạn lựa chọn.</span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"color:#000080;\"><u><strong>Địa Chỉ:</strong></u></span> Đường số 8 Khu Chung Cư Hiệp Thành 3 Thành Phố Thủ Dầu 1, Tỉnh Bình Dương.</span></p>\r\n\r\n<p><em><u><span style=\"color:#000080;\"><strong><span style=\"font-size:14px;\">#2. Mua hàng qua điện thoại:</span></strong></span></u></em></p>\r\n\r\n<p><span style=\"font-size:14px;\">      1. Chọn sản phẩm trên http://lilishop.vn.</span></p>\r\n\r\n<p><span style=\"font-size:14px;\">      2. Ghi các mã sản phẩm bạn cần vào giấy ( Như màu sản phẩm, size, cân nặng của Bé)</span></p>\r\n\r\n<p><span style=\"font-size:14px;\">      3. Điện thoại cho Chúng Tôi theo : 0938.947.566. Và Cung cấp mã sản phẩn, tên địa chỉ nhận hàng.</span></p>\r\n\r\n<p><span style=\"font-size:14px;\">Chúng Tôi sẽ giao hàng trong thời gian khách hàng yêu cầu, trước khi giao Chúng Tôi sẽ điện thoại thông báo cho quý khách trước.</span></p>\r\n\r\n<p><em><span style=\"color:#000080;\"><u><strong><span style=\"font-size:14px;\">#Cách 3: Mua hàng online qua trang web http/lilishop/vn</span></strong></u></span></em></p>\r\n\r\n<p> </p>\r\n\r\n<p> </p>\r\n\r\n<p> </p>\r\n\r\n<p> </p>\r\n\r\n<p> </p>\r\n\r\n<p style=\"margin: 0px; font-family: Arial, Helvetica, sans-serif; box-sizing: border-box; font-size: 13px; background-color: rgb(255, 255, 255);\"><span style=\"font-size:14px;\"><span style=\"font-family: arial, helvetica, sans-serif;\">.</span></span></p>\r\n', '', 1, '', '', '', 'huongdan', 69, NULL, NULL, NULL, NULL),
(41, 'Phương thức thanh toán khi mua hàng tại liliShop.vn', 'phuong-thuc-thanh-toan-khi-mua-hang-tai-lilishopvn', 'Khi quý khách mua hàng ở liliShop.vn thì đây là những phương thức thanh toán giúp quý khách có thể thanh toán dễ dàng hơn.', '<p><span style=\"color:#000080;\"><u><strong>#1. Thanh toán trực tiếp tại lilishop.</strong></u></span></p>\r\n\r\n<p>- Khi khách hàng mua và thanh toán trực tiếp tại shop theo địa chỉ: Đường số 8, Khu chung cư Hiệp Thành 3, Tp Phố Thủ Dầu 1, Bình Dương.</p>\r\n\r\n<p>- Thời gian mở cửa: </p>\r\n\r\n<p>            T2 đên T7: 9h- 19h30</p>\r\n\r\n<p>            CN: 8h30 - 17h30</p>\r\n\r\n<p><span style=\"color:#000080;\"><u><strong>#2. Thanh toán bằng chuyển khoản ngân hàng.</strong></u></span></p>\r\n\r\n<p>- Quý khách có thể thanh toán bằng chuyên khoản vào tài khoản ngân hàng sau:</p>\r\n\r\n<p>Chủ Tài Khoản: Nguyễn Văn Nhiệm</p>\r\n\r\n<p> Số Tài khoản : <strong>0511000402334.</strong></p>\r\n\r\n<p><strong>Ng</strong>ân Hàng: Vietcombank Chi Nhánh Nam sài gòn.</p>\r\n\r\n<p>Sau khi chuyển khoản vui lòng báo cho lilishop.vn biết, và lilishop.vn sẽ kiểm tra và chuyên hàng cho quý khách.</p>\r\n\r\n<p><span style=\"color:#000080;\"><u><strong>#3.Thanh toán khi nhận hàng (COD).</strong></u></span></p>\r\n\r\n<p>- Đối với những khách hàng mới làm việc với lilishop.vn Quý khách có thể chọn dịch vụ khi bạn nhận hàng thì sẽ thanh toán tiền với nhân viên giao hàng luôn.</p>\r\n', '', 1, '', '', '', 'huongdan', 45, NULL, NULL, NULL, NULL),
