(42, 'Phương Thức Vận Chuyển tại lilishop.vn', 'phuong-thuc-van-chuyen-tai-lilishopvn', 'Để thuận tiện cho việc mua hàng online LiliShop.vn có  hợp tác với các đơn vị vận chuyển đáng tin cậy và uy tín như bưu điện, viettel, giao hàng nhanh , shiper của shop.....giao nhanh hàng đến tận tay quý khách với mức phí ưu đãi nhất. ', '<p><u><span style=\"color:#FF0000;\">1. Phí Giao Hàng</span></u></p>\r\n\r\n<p>Để tạo điều kiện cho khách hàng thoải mái mua hàng không lo về phí ship, LiliShop hỗ trợ phí cho tất cả các đơn hàng như sau:</p>\r\n\r\n<p>- Miễn phí giao hàng với đơn hàng từ 500.000 trở lên trong phạm vi toàn quốc.</p>\r\n\r\n<p>- Đơn hàng dưới 500.000 phí giao hàng ưu đãi chỉ 25.000 - 30.000</p>\r\n\r\n<p>- Miễn phí giao hàng với đơn hàng từ 300.000 trở lên trong khu vực Bình Dương.</p>\r\n\r\n<p>- Mua ít hơn 300.000 phí ưu đãi chỉ 15.000 ( Trong khu vực tỉnh Bình Dương).</p>\r\n\r\n<p><u><span style=\"color:#FF0000;\">2. Thời Gian Giao Hàng</span></u></p>\r\n\r\n<p>- Khu vực bình dương: Từ 1 - 2 ngày ( Tính từ lúc nhân viên Lilishop gọi xác nhận đơn hàng với khách).</p>\r\n\r\n<p>- Các tỉnh thành khác: Từ 2_5 ngày ( Sẽ báo cho khách khi shop gọi xác nhận đơn hàng ).</p>\r\n\r\n<p><span style=\"color:#FF0000;\"><u>Lưu ý</u>:</span> </p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>Giao hàng trong tất cả các ngày từ thứ 2 đến thứ 6 ( Trừ ngày lễ và tết ) </p>\r\n	</li>\r\n	<li>\r\n	<p>Thời gian giao hàng là thời gian dự kiến</p>\r\n	</li>\r\n	<li>\r\n	<p>Thời gian giao hàng có thể đế sớm hơn hoặc trễ hơn tùy theo khu vực và một số điều kiện khách quan mà Lilishop không kiểm soát được ( như lũ lụt, hư hỏng phương tiện....)</p>\r\n	</li>\r\n</ul>\r\n\r\n<p> </p>\r\n', '', 1, '', '', '', 'huongdan', 19, NULL, NULL, NULL, NULL),
(43, 'Chính sách đổi trả hàng lilishop.vn', 'chinh-sach-doi-tra-hang-lilishopvn', 'Nhằm hỗ trợ khách mua online shop có chính sách đổi hàng .', '<p style=\"margin: 0px 0px 10px; background-color: rgb(255, 255, 255);\"><span style=\"font-family:helvetica;\"><span style=\"font-size: 13px;\">T<span style=\"font-size:14px;\">rong vòng 24h quý khách có nhu cầu đổi hàng vui lòng gọi số </span></span><span style=\"font-size:14px;\"><span style=\"background-color: rgb(255, 255, 255);\">0938.947.566 để shop hướng dẫn đổi hàng. Nếu sản phẩm lỗi shop sẽ chịu hoàn toàn phí ship đổi hàng cho quý khách, Các trường hợp khác khách hàng phải chịu phí ship đổi trả.</span></span></span></p>\r\n\r\n<p style=\"margin: 0px 0px 10px; background-color: rgb(255, 255, 255);\">Hàng đổi phải chưa qua giặt ủi và còn nguyên vẹn, nguyên tem như khi shop gửi khách.</p>\r\n\r\n<p style=\"margin: 0px 0px 10px; background-color: rgb(255, 255, 255);\"><strong><u>Cách Thức Đổi Hàng</u></strong>.</p>\r\n\r\n<p style=\"margin: 0px 0px 10px; background-color: rgb(255, 255, 255);\"><em><strong>1. Đối với khách hàng ở Bình Dương.</strong></em></p>\r\n\r\n<ul>\r\n	<li style=\"margin: 0px 0px 10px; background-color: rgb(255, 255, 255);\">Gọi cho shop và tới địa chỉ shop đổi hàng trực tiếp tại: Đường số 8 - Khu Chung Cư Hiệp Thành 3 - Thành Phố Thủ Dầu 1 - Bình Dương.</li>\r\n	<li style=\"margin: 0px 0px 10px; background-color: rgb(255, 255, 255);\">Nếu khách ở xa hoặc không có thời gian tới shop vui lòng gọi cho shop để hướng dẫn đổi hàng</li>\r\n</ul>\r\n\r\n<p><em><strong>2. Đối với khách hàng ở các tỉnh khác</strong>.</em></p>\r\n\r\n<ul>\r\n	<li> Qúy khách liên hệ với shop và gửi sản phẩm qua đường bưu điện để đổi hàng, sau khi nhận được hàng và kiểm tra hàng, shop sẽ ship sản phẩm khác cho quý khách.</li>\r\n</ul>\r\n\r\n<p> </p>\r\n', '', 1, '', '', '', 'huongdan', 16, NULL, NULL, NULL, NULL),
(45, 'THIÊN ĐƯỜNG HÀNG NHÁI QUẢNG CHÂU', 'thien-duong-hang-nhai-quang-chau', 'HÀNG FAKE TRÀNG NGẬP TRUNG QUỐC.', '<div class=\"sapo cms-desc\" id=\"chapeau\" style=\"box-sizing: border-box; font-family: Roboto-Bold; border-bottom: 1px solid rgb(237, 237, 237); margin-bottom: 12px; padding-bottom: 10px; font-size: 1.4rem; line-height: 2rem;\"><strong><span style=\"font-family: Roboto-Bold; font-size: 14px;\">Mua sắm hàng hiệu nhái, giả (fake) luôn được giới thiệu như một điểm đến không thể bỏ qua trong hành trình các tour có ghé Quảng Châu (Trung Quốc).</span></strong></div>\r\n\r\n<p style=\"text-align:center\"><img alt=\"\'Thiên đường\' hàng nhái Quảng Châu - ảnh 1\" src=\"http://image.thanhnien.vn/500/uploaded/2014/pictures201312/thanh_luan/6/hanggia1.jpg\" /></p>\r\n\r\n<p style=\"text-align: center;\"> <span style=\"color: rgb(89, 89, 89); font-family: Roboto-Regular, Arial, Helvetica, sans-serif; font-size: 14px; text-align: center;\">Phía sau phố đi bộ, mua sắm hào nhoáng Beijing Lu là các kho hàng giả - Ảnh: T. Phước - T.Phương</span></p>\r\n\r\n<p> </p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; font-size: 14px; font-family: Roboto-Regular, Arial, Helvetica, sans-serif; line-height: 2.2rem !important;\">Năm ngoái, trong một dịp ghé Quảng Châu công tác, ngày cuối được một “đại gia” ở đây hướng dẫn đi mua sắm. Cả đoàn ai cũng e dè vì người dẫn là chủ một tập đoàn đầu tư lớn ở địa phương, đi xe Mercedes S550, ở toàn khách sạn 5 sao thương hiệu lớn và từ đầu tới chân toàn xài đồ Louis Vuitton (L.V). Không nói nhưng ai cũng nghĩ: theo ông này mua sắm có mà chết!</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; font-size: 14px; font-family: Roboto-Regular, Arial, Helvetica, sans-serif; line-height: 2.2rem !important;\">“Đại gia” địa phương chở thẳng cả đoàn vô chợ đồ da Bạch Vân, trung tâm hàng nhái chuyên bán túi da, ví da... Mọi người thở phào nhẹ nhõm.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; font-size: 14px; font-family: Roboto-Regular, Arial, Helvetica, sans-serif; line-height: 2.2rem !important;\"><span style=\"box-sizing: border-box; font-family: Roboto-Bold, Arial, Helvetica, sans-serif; font-size: 1.4rem !important; line-height: 2.2rem !important;\">Vào kho hàng fake</span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; font-size: 14px; font-family: Roboto-Regular, Arial, Helvetica, sans-serif; line-height: 2.2rem !important;\">Trung tâm “thiên đường” (có lẽ của phụ nữ thì chính xác nhất) nằm trong một tòa nhà lớn trên đường Jiefang Beilu và Ziyuangang Lu. Kiểu buôn bán, bài trí giống như Saigon Square ở Q.1, TP.HCM; mỗi hiệu là một gian hàng được bố trí ngăn nắp, sạch sẽ, máy lạnh chạy cả khu. Tại đây, túi xách, ví và dây nịt là những mặt hàng chủ đạo, lác đác một số gian bán giày, quần áo nhưng lạ là hoàn toàn không mang một nhãn hiệu nổi tiếng nào, dù mới nhìn có thể đoán ngay đó là kiểu, màu chủ đạo của L.V, Hermès, Burberry... Hoặc nếu có thì là túi Paradi (nhái Prada), Cavern Kernel (nhái Calvin Klein)... nhìn sơ qua rất dễ bị nhầm.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; font-size: 14px; font-family: Roboto-Regular, Arial, Helvetica, sans-serif; line-height: 2.2rem !important;\">Đoán biết băn khoăn của khách, “đại gia” ra hiệu cho cả nhóm đi theo, rồi bấm thang máy lên tầng trên của khu mua sắm. Ở đây, căn hộ nào cũng làm cửa thép đóng im ỉm, camera an ninh gắn bên ngoài. Căn hộ mà “đại gia” địa phương dẫn đến cũng thế, ông này gõ cửa, nhấn chuông và gọi đủ kiểu, cửa vẫn đóng im ỉm. “Đại gia” rút điện thoại ra gọi, nói gì đó một hồi thì ít phút sau một cô gái từ dưới khu thương mại chạy lên tỏ vẻ vui mừng gặp khách cũ. Rất nhanh, cô chỉ bấm đúng một  tiếng chuông và nói một câu, lập tức cánh cửa thép mở ngay.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; font-size: 14px; font-family: Roboto-Regular, Arial, Helvetica, sans-serif; line-height: 2.2rem !important;\">Cả căn hộ bên trong gần 100 m2 là một kho túi xách, đủ các nhãn hiệu nổi tiếng thế giới. Hóa ra việc kinh doanh công khai bên dưới chỉ là điểm giao dịch, giới thiệu mẫu mã, còn khách muốn hàng giả có đầy đủ nhãn hiệu thì phải đứng đợi cửa hiệu lên các kho như thế này lấy hàng mang xuống. Hoặc nếu quen biết, mối mang hay có cò dẫn thì mới được lên tận kho chọn mua.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; font-size: 14px; font-family: Roboto-Regular, Arial, Helvetica, sans-serif; line-height: 2.2rem !important;\"> </p>\r\n\r\n<table align=\"right\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"box-sizing: border-box; border-collapse: collapse; border-spacing: 0px; font-size: 14px; margin-bottom: 15px; font-family: Roboto-Regular, Arial, Helvetica, sans-serif; height: auto; line-height: 2.2rem !important;\">\r\n	<tbody style=\"box-sizing: border-box; font-size: 1.4rem !important; line-height: 2.2rem !important;\">\r\n		<tr style=\"box-sizing: border-box; font-size: 1.4rem !important; line-height: 2.2rem !important;\">\r\n			<td style=\"box-sizing: border-box; width: 5px; font-size: 1.4rem !important; line-height: 2.2rem !important;\"> </td>\r\n			<td style=\"box-sizing: border-box; font-size: 1.4rem !important; line-height: 2.2rem !important;\">\r\n			<table align=\"right\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"box-sizing: border-box; border-collapse: collapse; border-spacing: 0px; margin-bottom: 15px; width: 250px; height: auto; font-size: 1.4rem !important; line-height: 2.2rem !important;\">\r\n				<tbody style=\"box-sizing: border-box; font-size: 1.4rem !important; line-height: 2.2rem !important;\">\r\n					<tr style=\"box-sizing: border-box; font-size: 1.4rem !important; line-height: 2.2rem !important;\">\r\n						<td align=\"left\" style=\"box-sizing: border-box; background-color: rgb(243, 178, 4); height: 8px; font-size: 1.4rem !important; line-height: 2.2rem !important;\" valign=\"middle\"> </td>\r\n					</tr>\r\n					<tr style=\"box-sizing: border-box; font-size: 1.4rem !important; line-height: 2.2rem !important;\">\r\n						<td style=\"box-sizing: border-box; text-align: justify; padding: 5px; background-color: rgb(250, 230, 171); font-size: 1.4rem !important; line-height: 2.2rem !important;\">\r\n						<p style=\"box-sizing: border-box; margin: 0px 0px 15px; color: rgb(0, 0, 0); font-size: 1.4rem !important; line-height: 2.2rem !important;\"><span style=\"box-sizing: border-box; color: rgb(139, 0, 0); font-size: 13px; line-height: 2.2rem !important;\">Sực nhớ đến cảm giác ngất ngây của mình khi ngắm hàng hiệu ở Tràng Tiền Plaza (Hà Nội) hay góc đường Đồng Khởi (TP.HCM) hình như mai một đi nhiều từ sau chuyến đến Quảng Châu</span></p>\r\n						</td>\r\n					</tr>\r\n					<tr style=\"box-sizing: border-box; font-size: 1.4rem !important; line-height: 2.2rem !important;\">\r\n						<td align=\"left\" style=\"box-sizing: border-box; background-color: rgb(243, 178, 4); height: 5px; font-size: 1.4rem !important; line-height: 2.2rem !important;\" valign=\"middle\"> </td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; font-size: 14px; font-family: Roboto-Regular, Arial, Helvetica, sans-serif; line-height: 2.2rem !important;\"> </p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; font-size: 14px; font-family: Roboto-Regular, Arial, Helvetica, sans-serif; line-height: 2.2rem !important;\">Những lần sau có dịp quay lại khu này, hóa ra cũng không cần đến phải cỡ “đại gia” mới biết chỗ để dẫn. Chỉ cần thấy khách Âu, Mỹ hay Phi và đặc biệt là khách Việt có “tai” (cách gọi phiên dịch) đi cùng là đội ngũ cò tranh thủ chào mời dẫn lên tận kho. Cò có thể dẫn đi bao nhiêu kho cũng được, không nề hà và đòi tiền bạc gì hết, hoa hồng hay thù lao kho tự tính với cò.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; font-size: 14px; font-family: Roboto-Regular, Arial, Helvetica, sans-serif; line-height: 2.2rem !important;\">Chủ một kho túi, ví nói: “Khách Việt qua đây nhiều lắm. Hiệu của tao còn đóng hàng L.V qua đến tận TP.HCM kia. Chỉ cần mày gửi mẫu qua email là 1 tuần sau hàng về tận nhà...”. Vừa nói chủ kho vừa quăng ra 3 - 4 cuốn catalogue năm 2013 của các thương hiệu thời trang nổi tiếng như Hermès, Dior, Gucci... cho khách tha hồ chọn mẫu nếu không muốn tìm kiếm trong hàng hàng lớp lớp túi xách, ví, bóp, cặp da, va li, dây nịt... chất khắp phòng.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; font-size: 14px; font-family: Roboto-Regular, Arial, Helvetica, sans-serif; line-height: 2.2rem !important;\">Đúng kiểu bán sỉ, khách càng mua nhiều càng rẻ. Chẳng hạn một cái túi mẫu mới nhất của Gucci, được coi là fake loại 1, ban đầu có giá 700 tệ (khoảng 2,4 triệu) nhưng khách mua 5 cái thì sẵn sàng bán 400 tệ (giá túi thật chính hãng cùng loại khoảng hơn 1.000 USD). Tất cả các hàng fake tại đây đều có cả hộp, túi lụa bọc ngoài, thậm chí cả thẻ chống giả, giấy chứng nhận xuất xứ từ Ý hay Pháp! Anh bạn trong đoàn mua được 10 cái bóp cầm tay, 5 túi xách các hiệu L.V, Gucci, Chanel hết 3.000 tệ (10,5 triệu), bằng mua 1 món nho nhỏ chính hãng.</p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"\'Thiên đường\' hàng nhái Quảng Châu - ảnh 2\" src=\"http://image.thanhnien.vn/500/uploaded/2014/pictures201312/thanh_luan/6/hanggia2.jpg\" /></p>\r\n\r\n<div id=\"abdf\" style=\"box-sizing: border-box; font-family: Roboto-Regular, Arial, Helvetica, sans-serif; font-size: 13px;\">\r\n<div class=\"clearfix\" id=\"main_detail\" style=\"box-sizing: border-box;\">\r\n<div class=\"cms-body\" id=\"abody\" style=\"box-sizing: border-box; margin-bottom: 15px; font-size: 1.4rem !important; line-height: 2.2rem !important;\">\r\n<table align=\"center\" border=\"2\" bordercolor=\"#f3b204\" cellpadding=\"0\" cellspacing=\"0\" rules=\"none\" style=\"box-sizing: border-box; border-collapse: collapse; border-spacing: 0px; margin-bottom: 15px; width: 485px; height: auto; font-size: 1.4rem !important; line-height: 2.2rem !important;\">\r\n	<tbody style=\"box-sizing: border-box; font-size: 1.4rem !important; line-height: 2.2rem !important;\">\r\n	</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<p style=\"text-align: center;\"> <span style=\"color: rgb(89, 89, 89); font-family: Roboto-Regular, Arial, Helvetica, sans-serif; font-size: 14px; text-align: center;\">Cánh cửa thép chỉ mở khi gọi đúng “mật khẩu”/bên trong là cả một nhà túi xách giả</span></p>\r\n\r\n<p> </p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; font-size: 14px; font-family: Roboto-Regular, Arial, Helvetica, sans-serif; line-height: 2.2rem !important;\">Chuyện kín kín hở hở bán hàng fake vẻ như là một cách đối phó với các chiến dịch tấn công hàng giả của chính quyền, rất dễ hình dung là làm cho có nhằm chứng minh bảo đảm cam kết về bảo vệ quyền sở hữu trí tuệ tại Trung Quốc. Khách mua hàng cũng được người bán khuyến cáo nên trùm một cái túi màu đen bên ngoài khi xách ra khỏi cửa hàng. Nhưng vào các ngày cuối tuần thì dọc hết các tuyến phố người ta bày cả ra đường hàng nhái, giả loại rẻ tiền bán công khai và sôi nổi như hội chợ.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; font-size: 14px; font-family: Roboto-Regular, Arial, Helvetica, sans-serif; line-height: 2.2rem !important;\">Đi một buổi ở khu chợ đồ da, sang cả chợ quần áo Bạch Mã đều có thể thấy tình hình chung là khách Việt đánh hàng từ Quảng Châu về gần như là VIP ở xứ này. Hình thành một chuỗi dịch vụ khép kín: xe khách đi từ Hà Nội sang, phiên dịch, giúp đặt khách sạn của người Việt tại Quảng Châu, đưa đi mua, khuân vác hàng và có cả công ty chuyên đóng hàng về Việt Nam treo biển hiệu rất to bằng tiếng Việt tại đây. Ngọc Giáp, một nghiên cứu sinh ở đây làm phiên dịch giúp chúng tôi đúc kết cách mua sắm ở “thiên đường” hàng fake này là cứ tha hồ mà trả giá: “Đừng lo họ phật lòng, cứ neo giá mà mình thấy là hợp lý, không ưng ý thì đi, hễ họ thấy lời là gọi lại bán, lời ít cũng bán...”.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; font-size: 14px; font-family: Roboto-Regular, Arial, Helvetica, sans-serif; line-height: 2.2rem !important;\"><span style=\"box-sizing: border-box; font-family: Roboto-Bold, Arial, Helvetica, sans-serif; font-size: 1.4rem !important; line-height: 2.2rem !important;\">Giá nào cũng bán</span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; font-size: 14px; font-family: Roboto-Regular, Arial, Helvetica, sans-serif; line-height: 2.2rem !important;\">Đúc kết này không chỉ đúng ở các chợ sỉ mà còn không sai chút nào tại khu mua sắm cho khách du lịch trên Bắc Kinh lộ (Beijing Lu), con phố đi bộ và mua sắm ở khu trung tâm. Tại đây bên cạnh những cửa hiệu lớn, rực rỡ bán hàng hiệu (nhưng hầu như không chấp nhận thanh toán bằng thẻ quốc tế Visa, Master Card; mà nhất nhất phải là UnionPay của Trung Quốc mới được), là những kho hàng fake nấp xung quanh phục vụ du khách. Lực lượng cò rải rác khắp con phố đi bộ, cầm những xấp hình sản phẩm L.V, Montblanc... chìa ra cho du khách và chào mời bằng tiếng Hoa - bất chấp khách da đen hay trắng. Chỉ cần gật đầu là họ dẫn len vào các ngõ hẻm quanh đó, lên tầng trên của những chung cư cũ kỹ ẩm thấp phía sau con phố mua sắm hào nhoáng lại những căn hộ có cửa đúng kiểu chúng tôi gặp ở chợ đồ da. Đa phần hàng hóa ở đây nhái nhưng chất lượng kém, cẩu thả và vì thế giá nào cũng bán!</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; font-size: 14px; font-family: Roboto-Regular, Arial, Helvetica, sans-serif; line-height: 2.2rem !important;\">Hôm cuối tạm biệt người bạn “đại gia”, đủ thân để hỏi một câu không tế nhị chút nào: “Tao cứ tưởng giàu như mày, xài xe Mercedes - thứ không thể nhái được rồi - và tiêu tiền thoải mái thì phải xài toàn đồ L.V thứ thiệt không chứ?”.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; font-size: 14px; font-family: Roboto-Regular, Arial, Helvetica, sans-serif; line-height: 2.2rem !important;\">Bạn “đại gia” đưa cái xách tay cho tôi cầm và bảo: “Lát nữa vào cửa hàng miễn thuế ở sân bay, mày cứ coi cái túi này với túi trong đó có khác gì nhau? Ngay cả khi có khác một vài chi tiết thì tao xài cũng không ai nghĩ đấy là hàng fake. Vậy tại sao lại bỏ ra một đống tiền làm giàu cho bọn Ý? Có thể tao giàu nhưng tao không có khùng!”.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; font-size: 14px; font-family: Roboto-Regular, Arial, Helvetica, sans-serif; line-height: 2.2rem !important;\">Vừa tức cười vừa nhớ một cậu hướng dẫn viên du lịch ở Việt Nam từng nói vui: “Các anh đào hoa thì nên đi Quảng Châu một lần. Qua đó mua sỉ túi xách, bóp hiệu... đóng thùng đem về dùng dần. Bỏ vô vài cục xà bông thơm cho nó có mùi hàng Mỹ. Rồi ráng kiếm túi đựng hàng của mấy cửa hàng miễn thuế sân bay Singapore hay Pháp, Đức... gì đó bỏ vô tặng nói anh mới đi châu Âu về là mấy em ngất ngây ngay...”.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; font-size: 14px; font-family: Roboto-Regular, Arial, Helvetica, sans-serif; line-height: 2.2rem !important;\">Sực nhớ đến cảm giác ngất ngây của mình khi ngắm hàng hiệu ở Tràng Tiền Plaza (Hà Nội) hay góc đường Đồng Khởi (TP.HCM) hình như mai một đi nhiều từ sau chuyến đến Quảng Châu. </p>\r\n', '', 1, '', '', '', 'tintuc', 71, NULL, NULL, NULL, NULL),
