(1, 'QBT0001', 'Quần bé trai in chữ Tiki', 'quan-be-trai-in-chu-tiki', NULL, 94, NULL, NULL, 150000, 135000, 'Lorem ipsum dolor sit amet, consectetur adipisicing elit. Atque delectus, maiores. Consequuntur ipsum molestiae, molestias optio porro rerum veniam voluptate.', '<pre>\r\nLorem ipsum dolor sit amet, consectetur adipisicing elit. Atque delectus, maiores. Consequuntur ipsum molestiae, molestias optio porro rerum veniam voluptate.</pre>\r\n\r\n<p>&nbsp;</p>', 'sd f', 's fsd f', 'sd fsd f', 0, 0, 0, 1, '2017-11-22 20:18:20', '2017-12-04 11:00:05'),
(2, NULL, 'Lam Dang', 'lam-dang', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 1, '2017-11-23 20:56:00', '2017-11-23 20:56:00'),
(3, 'BT0003', 'Đồ Bộ Bé Trai In Xe Hơi Size 9-12t', 'do-bo-be-trai-in-xe-hoi-size-9-12t', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 1, '2017-12-02 11:37:00', '2017-12-06 19:45:05'),
(4, 'BG0004', 'Likids đồ bộ bé gái thêu hình em bé cầm bóng dễ thương', 'likids-do-bo-be-gai-theu-hinh-em-be-cam-bong-de-thuong', NULL, 101, NULL, NULL, NULL, NULL, 'Đồ bộ lửng bé gái hình thêu cô bé cầm bóng cực kì dễ thương với chất liệu thun cotton co dãn 4 chiều thấm hút mồ hôi tốt, cho bé cảm giác thoải mái khi vận động, vui chơi cùng gia đình, bạn bè.', '<p>Đồ bộ b&eacute; g&aacute;i quần lửng, &aacute;o c&oacute;&nbsp;h&igrave;nh th&ecirc;u c&ocirc; b&eacute; cầm b&oacute;ng cực k&igrave; dễ thương với chất liệu thun cotton co d&atilde;n 4 chiều thấm h&uacute;t mồ h&ocirc;i tốt, cho b&eacute; cảm gi&aacute;c thoải m&aacute;i khi vận động, vui chơi c&ugrave;ng gia đ&igrave;nh, bạn b&egrave;.</p>', NULL, NULL, NULL, 0, 0, 0, 1, '2017-12-06 16:32:56', '2017-12-06 19:44:44'),
(5, 'BT0005', 'Đồ bộ bé trai in hình bóng chày áo thun quần kate caro', 'do-bo-be-trai-in-hinh-bong-chay-ao-thun-quan-kate-caro', NULL, 107, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 1, '2017-12-06 17:04:40', '2017-12-06 18:53:39');
