(55, 1, 0, 0, 'lam_7824-9688.png', 'lam_78244788_215x275.png', 'lam_78244910_415x530.png', '', 'Quần Jean Dài Bé Trai Wash Xước', 'quan-jean-dai-be-trai-wash-xuoc', 'Chất liệu: jean mềm , co giãn<br />\r\nLiên hệ: 0938.947.566', 'BT1707014', 145000, 0, '<p style=\"text-align: justify;\"><span style=\"font-size:18px;\">Quần jean chưa bao giờ có dấu hiệu thối trào mà ngượi lại nó luôn là thời trang không thể thiếu của bât cứ ai từ người lớn đến trẻ em. Vì sự tiện dụng dễ mặc, dễ phối đồ mà rất hợp thời trang, tạo cảm giác khỏe khắn thỏi mái cho người sử dụng. Quần jean dài cho bé trai của lilishop với chất liệu jean cotton mềm,  wash xước nhẹ tạo điểm nhấn cho quần. Với mẫu thiết kế đơn giản nhưng không kém phần sang trọng. Các mẹ hãy mau mau sắm cho con 1 chiếc để kết hợp áo sơ mi, áo pull ... để đi dự tiệc, đi chơi, đi học đều vô cùng đáng yêu và năng động.</span></p>\r\n\r\n<p><span style=\"font-size:20px;\"><strong>0938.947.566</strong></span></p>\r\n\r\n<p> </p>\r\n\r\n<p><img alt=\"\" height=\"920\" src=\"http://lilishop.vn/upload/images/LAM_7829.png\" width=\"720\" /></p>\r\n\r\n<p><span style=\"font-size:18px;\"><u><strong>Thông tin sản phầm:</strong></u></span></p>\r\n\r\n<p> </p>\r\n\r\n<table border=\"1\" bordercolor=\"#ccc\" cellpadding=\"5\" cellspacing=\"0\" style=\"border-collapse: collapse;\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"width: 106px;\">\r\n			<p>Tên sản phầm: </p>\r\n			</td>\r\n			<td style=\"width: 381px;\">\r\n			<p><span style=\"color:#000080;\">Quần dài bé trai wash sớt nhẹ giá tốt</span></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width: 106px;\">\r\n			<p>Mã sản phẩm: </p>\r\n			</td>\r\n			<td style=\"width: 381px;\">\r\n			<p>BT1707001</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width: 106px;\">\r\n			<p>Họa tiết:</p>\r\n			</td>\r\n			<td style=\"width: 381px;\">\r\n			<p>- Xanh đậm.</p>\r\n\r\n			<p>- Xanh nhạt</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width: 106px;\">\r\n			<p>Chất liệu:</p>\r