(72, 1, 0, 0, 'lam_6521_s-7826.jpg', 'lam_6521_s0106_215x275.jpg', 'lam_6521_s4405_415x530.jpg', '', 'Đầm Jean Bé Gái chữ A phối túi thật dễ thương.', 'dam-jean-be-gai-chu-a-phoi-tui-that-de-thuong', 'Size 5-8\" 155000', 'BG1707003', 145000, 0, '<p style=\"text-align: justify;\"><span style=\"font-size:18px;\">Sản phẩm từ chất jean chưa bao giờ là lỗi thời, mà nó luôn hiện hữu và phát triển ngày càng mạnh trong thời trang hằng ngày xung quanh ta. Đầm jean với thiết kế đơn giản phối vải lót hoa hai túi cá tính, nhẹ nhàng nhưng không kém phần sang trọng. Với chất vải jean cotton được sử lý wash nhẹ làm chiếc đầm trở nên mềm mại và nữ tính. </span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"font-size:18px;\">Li</span>ên hệ: <span style=\"color:#000080;\"><strong>0938.947.566</strong></span></p>\r\n\r\n<p> </p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"NO PHOTO\" src=\"http://lilishop.vn/upload/sanpham/lam_6521_s-7826.jpg\" /></p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"\" src=\"http://lilishop.vn/upload/hinhthem/lam6532s-3951.jpg\" /></p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"\" src=\"http://lilishop.vn/upload/hinhthem/lam6531s-1878.jpg\" /></p>\r\n\r\n<p> </p>\r\n\r\n<h2 style=\"font-style: italic;\"><span style=\"font-size: 26px;\"><u>Thông tin sản phẩm</u></span></h2>\r\n\r\n<table border=\"1\" bordercolor=\"#ccc\" cellpadding=\"5\" cellspacing=\"0\" style=\"border-collapse: collapse;\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"width: 141px;\">\r\n			<p>Tên sản phầm: </p>\r\n			</td>\r\n			<td style=\"width: 346px;\">\r\n			<p> Đầm Jean Bé Gái</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width: 141px;\">\r\n			<p>Mã sản phẩm: </p>\r\n			</td>\r\n			<td style=\"width: 346px;\">\r\n			<p>BT1706001</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width: 141px;\">\r\n			<p>Màu sắc:</p>\r\n			</td>\r\n			<td style=\"width: 346px;\">\r\n			<p> - Đậm</p>\r\n\r\n			<p> - Nhạt</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n	