(90, 1, 0, 0, 'lam_2264-4620.png', 'lam_22644844_215x275.png', 'lam_22641871_415x530.png', '', 'Đầm Thun In Chuột Mickey Đáng Yêu', 'dam-thun-in-chuot-mickey-dang-yeu', '', '1707052', 95000, 0, '<p style=\"text-align: justify;\"><span style=\"font-size:18px;\">Đầm với thiết kế phối viền cổ, viền tay, túi áo cộng với trước ngực in chuột mickey ngỗ nghĩnh đáng yêu. Ở phần eo may dây rút thuận tiện cho việc điều chỉnh vòng eo cho bé to nhỏ tùy thích. Sản phẩm với chất liệu thun cotton 4 chiều thoáng mát, mềm mịn cho bé yêu thoải mái vận động. Mẹ còn chần chừ gì nữa hãy mau liên hệ số 0938.947.566 để sắm ngay cho con yêu 1 chiếc đầm để diện đi học, đi chơi nào.</span></p>\r\n\r\n<p> </p>\r\n\r\n<p><img alt=\"\" src=\"http://lilishop.vn/upload/hinhthem/lam2276-294.png\" /></p>\r\n\r\n<p><img alt=\"NO PHOTO\" src=\"http://lilishop.vn/upload/sanpham/lam_2264-4620.png\" /></p>\r\n\r\n<p><img alt=\"\" src=\"http://lilishop.vn/upload/hinhthem/lam2284-7555.png\" /></p>\r\n\r\n<p><img alt=\"\" src=\"http://lilishop.vn/upload/hinhthem/lam2271-8334.png\" /></p>\r\n', 25, 1, 1, 1, '', 'Đầm Thun Chú Chuột Mickey hè thu 2018', 'Đầm Thun phối viền in chuột mickey', 'sanpham', ''),
(91, 1, 0, 0, 'lam_7714_l-4752.png', 'lam_7714_l2143_215x275.png', 'lam_7714_l8029_415x530.png', '', 'Áo bé trai sọc không cổ chất da cá', 'ao-be-trai-soc-khong-co-chat-da-ca', 'Riêng từ size 5 - 7 giá: 110.000 VND\r\n\r\nMẫu áo bé trai độc đáo dành cho bé từ 1 đến 7 tuổi với nhiều màu sắc cho bạn chọn lựa, sản phẩm thời trang thu đông cho trẻ em chất da cá mềm đẹp', 'BT1707020', 99000, 0, '<p style=\"text-align: justify;\"><span style=\"font-size:18px;\">Mưa gió bé không sợ lạnh với áo khoác sọc da cá gài nút đáng yêu, nhẹ nhàng dễ mặc. Áo với chất liệu da cá cotton mềm, co giãn. Sẽ rất thời trang nếu cho bé mặc quần jean dài, áo sơ mi trong gài nút cổ và khoác nhẹ áo sọc ngang mã số BT1707020..... Mẹ có thể phối với nhiều kiểu áo , quần khác nhau để diện cho con đi chơi, đi du lịch đều rất hợp thời trang và sang trọng. Sản phẩm với nhiều màu sắc khác nhau cho mẹ tha hồ lựa chọn. Liên hệ số <strong><span style=\"color:#0000CD;\">0938.947.566</span></strong> để được tư vấn cụ thể hơn.</span></p>\r\n\r\n<p style=\"text-align: justify;\"><img alt=\"NO PHOTO\" src=\"http://lilishop.vn/upload/sanpham/lam_7714_l-4752.png\" /></p>\r\n\r\n<p style=\"text-align: justify;\"><img alt=\"\" src=\"http://lilishop.vn/upload/hinhthem/lam7747l-1658.png\" /></p>\r\n\r\n<p style=\"text-align: justify;\"><img alt=\"\" src=\"http://lilishop.vn/upload/hinhthem/lam7740l-6146.png\" /></p>\r\n\r\n<p style=\"text-align: justify;\"><img alt=\"\" src=\"http://lilishop.vn/upload/hinhthem/lam7734l-6286.png\" /></p>\r\n\r\n<p style=\"text-align: justify;\"><img alt=\"\" src=\"http://lilishop.vn/upload/hinhthem/lam7729l-1630.png\" /></p>\r\n\r\n<p style=\"text-align: justify;\"><img alt=\"\" src=\"http://lilishop.vn/upload/hinhthem/lam7727l-4277.png\" /></p>\r\n\r\n<p style=\"text-align: justify;\"><img alt=\"\" src=\"http://lilishop.vn/upload/hinhthem/lam7721l-9091.png\" /></p>\r\n\r\n<p style=\"text-align: justify;\"><img alt=\"\" src=\"http://lilishop.vn/upload/hinhthem/lam7709l-9136.png\" /><