(92, 1, 0, 0, '1707028-2-0422.png', '1707028-23198_215x275.png', '1707028-23294_415x530.png', '', 'Áo khoác mùa thu 2017 bé gái thêu trái dâu.', 'ao-khoac-mua-thu-2017-be-gai-theu-trai-dau', 'Áo khoác bé gái size 1-4 thêu trái dâu, chất liệu da cá cotton mên mát giữa ấm  và nắng cho bé  rất tốt.', '1707028', 120000, 0, '<p style=\"text-align: justify;\"><span style=\"font-size:18px;\">Mùa mưa đến rồi các mẹ ơi, mỗi sáng và tối đếu xuất hiện những cơn gió se se lạnh. Khi ra đường các mẹ nhớ giữ ấm mặc thêm áo khoác cho con nhé. Lilishop cung cấp sản phẩm áo khoác thêu cô bé và những trái dâu xinh xắn, đáng yêu hết biết ah. Với chất vải da cá loại 1 mềm và mịn, sờ rất sướng tay nên mặc vào thì khỏi chê luôn ah. Sản phẩm với bốn màu rất chi là nữ tính cho mẹ tha hồ lựa chọn. Liên hệ <span style=\"color:#0000CD;\"><strong>0938.947.566</strong></span> để được tư vấn cụ thể.</span></p>\r\n\r\n<p style=\"text-align: justify;\"> </p>\r\n\r\n<p style=\"text-align: justify;\"><img alt=\"\" src=\"http://lilishop.vn/upload/hinhthem/17070287-1909.png\" /></p>\r\n\r\n<p style=\"text-align: justify;\"><img alt=\"NO PHOTO\" src=\"http://lilishop.vn/upload/sanpham/1707028-2-0422.png\" /></p>\r\n\r\n<p style=\"text-align: justify;\"><img alt=\"\" src=\"http://lilishop.vn/upload/hinhthem/17070286-1105.png\" /></p>\r\n\r\n<p style=\"text-align: justify;\"> </p>\r\n\r\n<h2 style=\"font-style: italic;\"><span style=\"font-size: 26px;\"><u>Thông tin sản phẩm</u></span></h2>\r\n\r\n<table border=\"1\" bordercolor=\"#ccc\" cellpadding=\"5\" cellspacing=\"0\" style=\"border-collapse: collapse;\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"width: 141px;\">\r\n			<p>Tên sản phầm: </p>\r\n			</td>\r\n			<td style=\"width: 346px;\">\r\n			<p> Áo Khoác Bé Gái Thêu Cô Bé Qủa Dâu</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width: 141px;\">\r\n			<p>Mã sản phẩm: </p>\r\n			</td>\r\n			<td style=\"width: 346px;\">\r\n			<p>BT1706001</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width