(94, 1, 0, 0, '1707033-3-1025.png', '1707033-33423_215x275.png', '1707033-31073_415x530.png', '', 'BỘ ĐỒ DÀI THU ĐÔNG 2017 BÉ TRAI THÊU CHÚ KHÚNG LONG NGỖ NGHĨNH', 'bo-do-dai-thu-dong-2017-be-trai-theu-chu-khung-long-ngo-nghinh', '', '1707033', 110000, 0, '<p style=\"text-align: justify; \"><span style=\"font-size:18px;\">Bộ dài tay thêu hình chú khủng long ngộ nghĩnh, đáng yêu. Với thiết kế phần bo cổ to nhằm mục đích giữ ấm được cho các bé, quần phối 2 sọc chạy dài từ túi xuống lai quần khỏe khắn và cá tính. Sản phẩm dành cho bé từ 8kg - 17kg và dành cho cả bé trai, bé gái đều mặc được. Sản phẩm được thiết kế cho các bé nhỏ nên phần quần được thiết kế rộng phần mông và đáy cho bé thuận tiện việc mặc tã. Các bạn muốn mua sản phẩm thì liên hệ số <span style=\"color:#0000CD;\"><strong>0938.947.566</strong></span> để được hướng dẫn cụ thể.</span></p>\r\n\r\n<p style=\"text-align: justify; \"> </p>\r\n\r\n<p style=\"text-align: justify; \"><img alt=\"NO PHOTO\" src=\"http://lilishop.vn/upload/sanpham/1707033-3-1025.png\" /></p>\r\n\r\n<p style=\"text-align: justify; \"><img alt=\"\" src=\"http://lilishop.vn/upload/hinhthem/17070331-1485.png\" /></p>\r\n\r\n<p style=\"text-align: justify; \"><img alt=\"\" src=\"http://lilishop.vn/upload/hinhthem/326138674220dobobetraicottonthudongdo5size15t-1832.png\" /></p>\r\n\r\n<p style=\"text-align: justify; \"> </p>\r\n\r\n<h2 style=\"font-style: italic;\"><span style=\"font-size: 26px;\"><u>Thông tin sản phẩm</u></span></h2>\r\n\r\n<table border=\"1\" bordercolor=\"#ccc\" cellpadding=\"5\" cellspacing=\"0\" style=\"border-collapse: collapse;\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"width: 141px;\">\r\n			<p>Tên sản phầm: </p>\r\n			</td>\r\n			<td style=\"width: 346px;\">\r\n			<p> BỘ DÀI TAY THU ĐÔNG 2017 THÊU KHỦNG LONG</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width: 141px;\">\r\n			<p>Mã sản phẩm: </p>\r\n			</td>\r\n			<td style=\"width: 346px;\">\r\n			<p>BT1706001</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<