(97, 1, 0, 0, 'lam_0009-1827.png', 'lam_00098507_215x275.png', 'lam_00094694_415x530.png', '', 'Đồ bộ bé trai cotton thời trang hè năng động', 'do-bo-be-trai-cotton-thoi-trang-he-nang-dong', 'Size 1 - 4: 105000 VND<br />\r\nSize 5 - 8: 115000 VND<br />\r\nĐồ bộ bé trai in Detroit thương hiệu Likids nhiều màu sắc, mẫu thiết kế thời trang trẻ em hè 2017 - 2018 chất liệu vải cotton mềm đẹp dễ sử dụng, tạo cảm giác dễ chịu cho bé.', '1707026', 105000, 0, '<p>Đồ bộ bé trai cotton in DETROIT với nét độc đáo hình in áo không bong tróc, kết hợp với 2 đường sọc dọc sườn quần tạo cảm giác khỏe khoắn.</p>\r\n\r\n<p>Sản phẩm thương hiệu LIKIDS , chất liệu thun cotton 100% co giãn 4 chiều, thấm hút mồ hôi tốt, yên tâm cho bé thỏa sức vui chơi cùng gia đình, bạn bè  trong mùa hè đầy năng động này! Sản phẩm dành cho các bé trong khoảng cân nặng từ 12 đến 25kg mặc vừa, có nhiều màu sắc để lựa chọ ah ( màu nào cũng đẹp, sắc nào cũng mê các mẹ ah! :)</p>\r\n\r\n<p>Các mẹ hãy nhanh chân đến với LILISHOP để sở hữu ngay cho bé yêu nhà mình các sản phẩm đáng yêu này nhé!</p>\r\n\r\n<p>Liên hệ 0938 947 566 để được tư vấn kĩ hơn .</p>\r\n\r\n<p><img alt=\"NO PHOTO\" src=\"http://lilishop.vn/upload/sanpham/lam_0009-1827.png\" /></p>\r\n\r\n<p><img alt=\"\" src=\"http://lilishop.vn/upload/hinhthem/lam0045-3177.png\" /></p>\r\n\r\n<p><img alt=\"\" src=\"http://lilishop.vn/upload/hinhthem/lam0040-9375.png\" /><img alt=\"\" src=\"http://lilishop.vn/upload/hinhthem/lam0002-548.png\" /></p>\r\n', 39, 1, 1, 1, 'Đồ bộ bé trai cotton thời trang hè năng động', 'đồ bộ hè bé trai 2017', 'thời trang hè bé trai dành cho bé từ 1 đến 4 và bé trai từ 5 đến 8 tuổi thương hiệu thời trang likids.', 'sanpham', ''),
(98, 1, 0, 0, 'lam_9991-6146.png', 'lam_99918979_215x275.png', 'lam_99912089_415x530.png', '', 'Đầm Công Chúa Ren 3 Lớp Gắn Hoa Hồng', 'dam-cong-chua-ren-3-lop-gan-hoa-hong', 'Đầm ren bé gái đính hoa dành cho bé từ 1 đến 8 tuổi, chất lượng vải ren tốt thiết kế và may đẹp sẽ cho bé một mẫu đầm sang trọng và dễ thương cho mùa xuân sắp đến.', '1707025', 235000, 0, '<p style=\"text-align: justify;\"><span style=\"font-size:18px;\">Tháng 8 trở lên là tháng của lễ hội, đám cưới và tiệc tùng nên các mẹ mau mau sắm cho các con gái yêu những chiếc đầm công chúa xinh xắn, sang trọng để con diện đi chơi các mẹ nhé. Đầm công chúa gắn hoa của Lilishop với thiết kế 3 lớp, lớp trong cùng là vải lót cotton tiếp đến là lớp phi bóng và ngoài cùng là lớp ren, sản phẩm kèm cài tóc trùng với màu đầm sang trọng và cá tính. Điểm nhấn ở hoa hồng cài áo bằng kim băng có thể tháo ra khi giặc rất tiện lợi, các mẹ mua hàng liên hệ số <span style=\"color:#0000FF;\"><strong>0938.947.566</strong></span> để được tư vấn cụ thể hơn ah.</span></p>\r\n\r\n<p style=\"text-align: justify;\"> </p>\r\n\r\n<p style=\"text-align: justify;\"><img alt=\"NO PHOTO\" src=\"http://lilishop.vn/upload/sanpham/lam_9991-6146.png\" /></p>\r\n\r\n<p style=\"text-align: justify;\"><img alt=\"\" src=\"http://lilishop.vn/upload/hinhthem/lam9984-764.png\" /></p>\r\n\r\n<p style=\"text-align: justify;\"><img alt=\"\" src=\"http://lilishop.vn/upload/hinhthem/lam9954-994.png\" /></p>\r\n\r\n<p style=\"text-align: justify;\"><img alt=\"\" src=\"http://lilishop.vn/upload/hinhthem/lam9945-2014.png\" /></p>\r\n\r\n<p style=\"text-align: justify;\"> </p>\r\n\r\n<h2 style=\"font-style: italic;\"><span style=\"font-size: 26px;\"><u>Thông tin sản phẩm</u></span></h2>\r\n\r\n<table border=\"1\" bordercolor=\"#ccc\" cellpadding=\"5\" cellspacing=\"0\" style=\"border-collapse: collapse;\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"width: 141px;\">\r\n			<p>Tên sản phầm: </p>\r\n			</td>\r\n			<td style=\"width: 346px;\">\r\n			<p> Đầm Côn