(99, 1, 0, 0, 'lam_1694-8428.png', 'lam_16940807_215x275.png', 'lam_16945068_415x530.png', '', 'Đồ bộ bé trai cotton 100% in nổi thời trang hè', 'do-bo-be-trai-cotton-100-in-noi-thoi-trang-he', 'Size 1 - 5: 99.000 VND<br />\r\nSize 6 - 10: 115.000 VND<br />\r\nĐồ bộ bé trai dành cho bé trai từ 1 đến 10 tuổi thời trang hè 2017 nhiều màu sắc chất vải cotton mềm đẹp.', '1707029', 99000, 0, '<p>Đồ bộ bé trai in  bàn tay nổi chữ HANDS DOWN tạo điểm nhấn cho bé, quần ngắn áo ba lỗ dễ mặc , đường viền phối đẹp mắt. </p>\r\n\r\n<p>Thương hiệu độc quyền LIKIDS cũng đã được phát triển và đồng hành cùng khách hàng trong nhiều năm trở lại đây,với kiểu thết kế riêng độc đáo và lạ mắt, kết hợp các mẫu hình in, thêu dễ thương , tha hồ cho cá bé và mẹ lựa chọn.</p>\r\n\r\n<p>Chất liệu thun cotton 100%, co dãn 4 chiều, thấm hút mồ hôi tốt,tạo cho bé cảm giác thoải mái, tự do trong các hoạt động vui chơi giải trí ngoài trời mà không lo mồ hôi làm cho khó chịu. Các mẹ còn chần chờ gì nữa mà không nhanh tay lựa cho bé nhà mình 1 mẫu sản phẩm này nhỉ, chắc chắn các bé sẽ thích lắm đấy ah. Có nhiều màu sắc cho các mẹ lựa chọn dưới đây nhé!</p>\r\n\r\n<p><img alt=\"Đồ bộ bé trai cotton 100% in nổi thời trang hè\" src=\"http://lilishop.vn/upload/sanpham/lam_16940807_215x275.png\" /></p>\r\n\r\n<p><img alt=\"\" src=\"http://lilishop.vn/upload/hinhthem/lam1702-141722_88x112.png\" /></p>\r\n\r\n<p><img alt=\"\" src=\"http://lilishop.vn/upload/hinhthem/lam1707-30559676_88x112.png\" /></p>\r\n\r\n<p><img alt=\"\" src=\"http://lilishop.vn/upload/hinhthem/lam1697-48236798_88x112.png\" /></p>\r\n', 39, 1, 1, 1, 'Đồ bộ bé trai cotton 100% in nổi thời trang hè', 'đồ bộ bé trai ba lỗ', 'Đồ bộ bé trai thương hiệu likids màu sắc thời trang hè 2017 chất liệu vải tốt.', 'sanpham', ''),
(100, 1, 0, 0, 'lam_7912-9796.png', 'lam_79126371_215x275.png', 'lam_79128846_415x530.png', '', 'Áo khoác bé trai chất vải da cá thêu spider man', 'ao-khoac-be-trai-chat-vai-da-ca-theu-spider-man', 'Áo khoác bé trai dành cho bé từ 1 đến 8 tuổi chất vải da cá dày mềm dành cho thời trang thu đông.', '1707037', 139000, 0, '<p style=\"text-align: justify;\"><span style=\"font-size:18px;\">Áo khoác không những giữ ấm, chống nắng tốt mà phải còn thời trang mới là một chiếc áo khoác đúng nghĩa. Áo khoác may kiểu áo bóng chày, phần tay, cổ, và lai áo được phối màu sành điệu. Áo được may miếng bạ hình bầu dục đắp ở khủyu 2 bên tay áo cá tính, ngực áo thêu biểu tượng người nhện đáng yêu. Sản phẩm với chất liệu da cá mềm, dành cho bé từ 12kg - 25kg. Áo rất cá tính và thời trang các mom ah, sản phẩm có 3 màu cực yêu. Liên hệ số <strong><span style=\"color:#0000CD;\">0938.947.566</span></strong> để được tư vấn cụ thể</span></p>\r\n\r\n<p style=\"text-align: justify;\"> </p>\r\n\r\n<p style=\"text-align: justify;\"><img alt=\"NO PHOTO\" src=\"http://lilishop.vn/upload/sanpham/lam_7912-9796.png\" /></p>\r\n\r\n<p style=\"text-align: justify;\"><img alt=\"\" src=\"http://lilishop.vn/upload/hinhthem/lam7899-1304.png\" /></p>\r\n\r\n<p style=\"text-align: justify;\"><img alt=\"\" src=\"http://lilishop.vn/upload/hinhthem/lam7908-4495.png\" /></p>\r\n\r\n<p style=\"text-align: justify;\"> </p>\r\n\r\n<h2 style=\"font-style: italic;\"><span style=\"font-size: 26px;\"><u>Thông tin sản phẩm</u></span></h2>\r\n\r\n<table border=\"1\" bordercolor=\"#ccc\" cellpadding=\"5\" cellspacing=\"0\" style=\"border-collapse: collapse;\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"width: 141px;\">\r\n			<p>Tên sản phầm: </p>\r\n			</td>\r\n			<td style=\"width: 346px;\">\r\n			<p> ÁO KHOÁC CHO BÉ KIỂU BÓNG CHÀY 2018</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width: 141px;\">\r\n			<p>Mã sản phẩm: </p>\r\n			</td>\r\n			<td style=\"width: 346px;\">\r\n			<p>BT1706001</p>\r\n			</td>\r\n		</tr>