(101, 1, 0, 0, 'lam_7920-1835.png', 'lam_79206693_215x275.png', 'lam_79203681_415x530.png', '', 'Áo bé trai dày tay thêu suber superman chất cotton 100%', 'ao-be-trai-day-tay-theu-suber-superman-chat-cotton-100', 'Mẫu áo dài tay bé trai thêu logo suberman chất liệu vải cotton mềm mát đẹp, thời trang mùa thu 2017 với nhiều màu sắc cho sự chọn lựa.', '1707038', 85000, 0, '<p style=\"text-align: justify;\"><span style=\"font-size:18px;\">Áo lẻ bé trai dài tay thêu biểu tượng siêu nhân kết hợp với quần jean, kaki dài là đúng chất thời trang cho mùa thu đông này luôn ah. Với thiết kế áo cổ may bo bảng to để giữ ấm cổ, sản phẩm với chất liệu thun cotton 4 chiều thấm hút mồ hôi, co giãn thoải mái và mềm mịn. Sản phẩm dành cho bé từ 15kg - 28kg, với nhiều màu sắc cho các bạn tha hồ lựa chọn. Để mua sản phẩm các bạn liên hệ <strong><span style=\"color:#0000FF;\">0938.967.566</span></strong> để được tư vấn cụ thể.</span></p>\r\n\r\n<p><img alt=\"NO PHOTO\" src=\"http://lilishop.vn/upload/sanpham/lam_7920-1835.png\" /></p>\r\n\r\n<p><img alt=\"\" src=\"http://lilishop.vn/upload/hinhthem/lam7924-4044.png\" /></p>\r\n\r\n<p><img alt=\"\" src=\"http://lilishop.vn/upload/hinhthem/lam7933l-7604.png\" /></p>\r\n\r\n<p><img alt=\"\" src=\"http://lilishop.vn/upload/hinhthem/lam7919-2721.png\" /></p>\r\n\r\n<p><img alt=\"\" src=\"http://lilishop.vn/upload/hinhthem/lam7915-3942.png\" /></p>\r\n\r\n<p> </p>\r\n\r\n<h2 style=\"font-style: italic;\"><span style=\"font-size: 26px;\"><u>Thông tin sản phẩm</u></span></h2>\r\n\r\n<table border=\"1\" bordercolor=\"#ccc\" cellpadding=\"5\" cellspacing=\"0\" style=\"border-collapse: collapse;\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"width: 141px;\">\r\n			<p>Tên sản phầm: </p>\r\n			</td>\r\n			<td style=\"width: 346px;\">\r\n			<p> Áo lẻ bé trai dài tay in siêu nhân</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width: 141px;\">\r\n			<p>Mã sản phẩm: </p>\r\n			</td>\r\n			<td style=\"width: 346px;\">\r\n			<p>BT1706001</p>\r\n			</td>