(102, 1, 0, 0, 'lam_7490-7681.JPG', 'lam_74900680_215x275.jpg', 'lam_74904453_415x530.jpg', '', 'Đồ bộ bé trai spiderman dài tay phụ kiện mặt nạ', 'do-bo-be-trai-spiderman-dai-tay-phu-kien-mat-na', 'Chất liệu: Thun cotton 4 chiều<br />\r\nLiên hệ: 0938.947.566<br />\r\nĐồ bộ cotton spiderman bé trai bao gồm phu kiện mặt nạ dễ thương và cá tính, dành cho bé từ 3 đến 10 tuổi, thời trang thu đông 2017 với chất liệu vải tốt mềm mát sẽ tạo cảm giác dễ chịu cho bé khi mặc.', '1707039', 140000, 0, '<p style=\"text-align: justify;\"><span style=\"font-size:18px;\">Mùa thu đông năm nay lại đến sớm rồi các mẹ nhỉ, sáng sáng đã thấy lành lạnh. Trời lạnh thì việc giữ ấm cho các con rất quan trọng, hiểu được nỗi lòng của các bậc cha mẹ, lilishop cung cấp bộ dài tay bé trai thân phối màu in nhện kèm mặt nạ cho bé thỏa chí hóa thân vào nhân vật siêu anh hùng lừng lanh. Sản phẩm dành cho bé từ 15kg - 35kg với chất liệu thun cotton 4 chiều thấm hút mồ hôi và giữ ấm cực tốt. Thiết kế với bo tay, bo chân ôm khít nhằm tăng khả năng giữ ấm cho bé. Liên hệ : <strong><span style=\"color:#0000CD;\">0938.947.566</span></strong> để được tư vấn cụ thể hơn.</span></p>\r\n\r\n<p> </p>\r\n\r\n<p><img alt=\"NO PHOTO\" src=\"http://lilishop.vn/upload/sanpham/lam_7490-7681.JPG\" /></p>\r\n\r\n<p><img alt=\"\" src=\"http://lilishop.vn/upload/hinhthem/lam7496-6007.JPG\" /></p>\r\n\r\n<p><img alt=\"\" src=\"http://lilishop.vn/upload/hinhthem/lam7499-7808.JPG\" /></p>\r\n\r\n<p> </p>\r\n\r\n<h2 style=\"font-style: italic;\"><span style=\"font-size: 26px;\"><u>Thông tin sản phẩm</u></span></h2>\r\n\r\n<table border=\"1\" bordercolor=\"#ccc\" cellpadding=\"5\" cellspacing=\"0\" style=\"border-collapse: collapse;\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"width: 141px;\">\r\n			<p>Tên sản phầm: </p>\r\n			</td>\r\n			<td style=\"width: 346px;\">\r\n			<p> Bộ Dài Tay Bé Trai In Nhện Thu Đông 2017</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width: 141px;\">\r\n			<p>Mã sản phẩm: </p>\r\n			</td>\