(103, 1, 0, 0, 'lam_6647_l-3678.png', 'lam_6647_l0825_215x275.png', 'lam_6647_l0068_415x530.png', '', 'Đồ bộ bé gái cotton nơ đen dài tay thời trang thu', 'do-bo-be-gai-cotton-no-den-dai-tay-thoi-trang-thu', 'Size: 1- 4 giá 110.000<br />\r\nSize: 5 - 8 giá 135.000 VND<br />\r\nĐồ bộ bé gái dài tay thời trang mùa thu dành cho bé gái từ 1 đến 8 tuổi thương hiệu likids màu sắc đa dạng chất vải cotton 100% tạo cảm giác dễ chịu hơn cho bé khi mặc.', 'MS1707042', 110000, 0, '', 22, 1, 1, 1, 'Đồ bộ bé gái cotton nơ đen dài tay thời trang thu', 'đồ bộ bé gái cotton in tim', 'Đồ bộ bé gái cotton thời trang mùa hè 2017 dành cho bé từ 1 đến 8 tuổi, chất vải 100% cotton', 'sanpham', ''),
(104, 1, 0, 0, '274094673923-quan-short-jean-be-gai-day-nit-da-dam-7size-17-3511.jpg', '274094673923-quan-short-jean-be-gai-day-nit-da-dam-7size-173222_215x275.jpg', '274094673923-quan-short-jean-be-gai-day-nit-da-dam-7size-178451_415x530.jpg', '', 'Quần short jean bé gái kèm thắt lưng wash nhẹ phối túi xinh xắn.', 'quan-short-jean-be-gai-kem-that-lung-wash-nhe-phoi-tui-xinh-xan', 'Size:1_4t  giá 105k <br />\r\nSize; 5_7t giá  115k<br />\r\nQuần short jean bé gái với chất jean mềm co giãn, tạo cảm giác thoải mái cho các bé khi mặc. Sản phẩm kèm phụ kiện thắt lưng xinh xắn ', '1707051', 105000, 0, '<p style=\"text-align: justify;\"><span style=\"font-size:18px;\">Mom nào có con gái thì ai cũng biết sự tiện dụng và hiện diện của quần jean trong tủ đồ của các con. Nhất là đối với quần short jean rất dễ mặc, dễ phối với tất cả các áo phông cũng như áo sơ mi form dài. Short jean kèm thắt lưng quần wash nhẹ phối túi sau với chất jean mềm, co giãn dành cho bé từ 1 tuổi đến 7 tuổi  ( tương ứng bé từ 10kg - 23kg ) . Quần xinh lung linh mà còn kèm thắt lưng da xinh xắn, đáng yêu quá các mẹ ah. Mẹ nào có con gái hoặc có nhu cầu mua quà tặng các bé yêu thì đừng bỏ qua sản phẩm quần short jean đáng yêu này của shop lili nhé. </span></p>\r\n\r\n<p><span style=\"font-size:18px;\">Liên hệ: 0938.947.566 để được tư vấn cụ thể hơn.</span></p>\r\n\r\n<p> </p>\r\n\r\n<p><img alt=\"NO PHOTO\" src=\"http://lilishop.vn/upload/sanpham/274094673923-quan-short-jean-be-gai-day-nit-da-dam-7size-17-3511.jpg\" /></p>\r\n\r\n<p><img alt=\"\" src=\"http://lilishop.vn/upload/hinhthem/622687351043quanshortjeanbegaidaynitdanhat7size17-9132.jpg\" /></p>\r\n\r\n<p> </p>\r\n\r\n<h2 style=\"font-style: italic;\"><span style=\"font-size: 26px;\"><u>Thông tin sản phẩm</u></span></h2>\r\n\r\n<table border=\"1\" bordercolor=\"#ccc\" cellpadding=\"5\" cellspacing=\"0\" style=\"border-collapse: collapse;\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"width: 141px;\">\r\n			<p>Tên sản phầm: </p>\r\n			</td>\r\n			<t