(105, 1, 0, 0, '973055665474-quan-legging-be-gai-cotton-cham-bi-hong-10size-110-9806.png', '973055665474-quan-legging-be-gai-cotton-cham-bi-hong-10size-1103705_215x275.png', '973055665474-quan-legging-be-gai-cotton-cham-bi-hong-10size-1100599_415x530.png', '', 'Quần legging lững phối ren in chấm bi cho bé yêu', 'quan-legging-lung-phoi-ren-in-cham-bi-cho-be-yeu', 'Size: 1_6t giá 35k<br />\r\nSize: 7_10t giá 39k<br />\r\nQuần legging lững bé gái với chất vải thun cotton mềm, thoáng mát, co giãn tốt cho bé thoải mái vận động', '1707050', 35000, 0, '', 21, 1, 1, 1, 'Quần legging  cho bé gái ', 'Quần legging lững chấm bi bé gái 2017', 'Quần legging lững chấm bi chất liệu thun cotton thoáng mát, co giãn thoải mái cho bé yêu nhà bạn', 'sanpham', ''),
(106, 1, 0, 0, '685270379508-quan-jean-be-gai-cao-thoi-trang-nhat-8size-18-8836.jpg', '685270379508-quan-jean-be-gai-cao-thoi-trang-nhat-8size-187290_215x275.jpg', '685270379508-quan-jean-be-gai-cao-thoi-trang-nhat-8size-183084_415x530.jpg', '', 'Quần short jean bé gái lai rách nhẹ cá tính', 'quan-short-jean-be-gai-lai-rach-nhe-ca-tinh', 'Size: 1_4t giá  105k<br / >\r\nSize: 5_8t giá  115k<br />\r\nQuần short jean lai rách nhẹ cá tính với lưng thun cho bé dễ mặc, với chất liệu jean mềm, nhẹ, con giãn. ', '1707049', 105000, 0, '', 32, 1, 1, 1, 'Quần short jean bé gái ', 'Quần short jean bé gái kiểu rách lai', 'Quần short jean bé gái lai rách tua rua, với chất liệu jean mềm, nhẹ tạo cảm giác thoải mái cho bé khi sử dụng', 'sanpham', ''),
(107, 1, 0, 0, '748099701294-quan-be-trai-jean-mem-cao-lung-xanh-dam-8size-310t-3563.png', '748099701294-quan-be-trai-jean-mem-cao-lung-xanh-dam-8size-310t3463_215x275.png', '748099701294-quan-be-trai-jean-mem-cao-lung-xanh-dam-8size-310t2647_415x530.png', '', 'Quần jean lững bé trai wash rách cá tính', 'quan-jean-lung-be-trai-wash-rach-ca-tinh', 'Chất: Jean cotton<br />\r\nLiên hệ: 0938.947.566\r\n', '1707047', 150000, 0, '<p>Lilishop gửi đến các mẹ mẫu thời trang Quần Jean lững bé trai wash rách cá tính, không ra màu, không xù với chất liệu Jean cotton mềm mịn, co dãn và thoáng mát, tạo cho bé cảm giác thoải mái khi sử dụng. Các bé có thể mặc đi chơi, đi học,... đều có phong cách  độc đáo riêng cho mỗi bé nhà mình!</p>\r\n\r\n<p>Các mẹ hãy nhanh chân đến với Lilishop để rước em nó về cho bé yêu nhà  mình ngay nhé!</p>\r\n\r\n<p>Sản phẩm dành cho bé khoảng từ 15-30kg mặc vừa, mọi chi tiết liên hệ 0938.947.566 .</p>\r\n\r\n<p><img alt=\"NO PHOTO\" src=\"http://lilishop.vn/upload/sanpham/748099701294-quan-be-trai-jean-mem-cao-lung-xanh-dam-8size-310t-3563.png\" /></p>\r\n\r\n<p><img alt=\"\" src=\"http://lilishop.vn/upload/hinhthem/598365563661quanbetraijeanmemcaolungxanhnhat8size310t-5115.png\" /></p>\r\n', 48, 1, 1, 1, 'Quần jean lững wash rách nhẹ', 'Quần jean lững bé trai cào rách nhẹ', 'Với chất liệu jean cotton thoáng mát, mềm và kiểu dáng cào rách nhẹ cá tính tạo phong cách cho các bé yêu.', 'sanpham', ''),
(108, 1, 0, 0, '874637927389-quan-be-trai-day-deo-kaki-short-theu-xanh-ngoc-8size-18t-4919.jpg', '874637927389-quan-be-trai-day-deo-kaki-short-theu-xanh-ngoc-8size-18t4898_215x275.jpg', '874637927389-quan-be-trai-day-deo-kaki-short-theu-xanh-ngoc-8size-18t1872_415x530.jpg', '', 'Quần kaki lững kèm dây đeo', 'quan-kaki-lung-kem-day-deo', 'Chất: Kaki mềm<br />\r\nLiên hệ: 0938.947.566\r\nQuần kaki mềm thêu oto kèm dây đeo đáng yêu, với chất kaki cotton thoáng mát, mềm thoải mái cho bé vận động', '1707046', 130000, 0, '<p>Lilishop chào các mẹ ah!</p>\r\n\r\n<p>Các mẹ ơi, mẫu quần kaki kèm dây đeo này hiện đang rất hot đấy ah! Chất Kaki mềm kết hợp hình thêu chiếc oto độc đáo, tạo nên phong cách cá tính, khỏe khoắn cho các bé!</p>\r\n\r\n<p>Quần kaki này mặc kèm với áo thun hay sơ mi đều rất hợp ah, Dây đeo có thể tháo ra lắp vào dễ dàng nên có thể thay đổi phong cách mới cho bé ( kèm dây đeo hoặc tháo ra), các mẹ tha hồ phối đồ cho bé yêu theo cách riêng của mình nữa nhé!</p>\r\n\r\n<p>Sản phẩm dành cho bé từ 10kg đến 25 kg mặc vừa, Liên hệ  0938.947.566 để được tư vấn rõ hơn.</p>\r\n\r\n<p><img alt=\"NO PHOTO\" src=\"http://lilishop.vn/upload/sanpham/874637927389-quan-be-trai-day-deo-kaki-short-theu-xanh-ngoc-8size-18t-4919.jpg\" /></p>\r\n\r\n<p><img alt=\"\" src=\"http://lilishop.vn/upload/hinhthem/727141438971quanbetraidaydeokakishorttheuvang8size18t-4118.jpg\" /></p>\r\n\r\n<p><img alt=\"\" src=\"http://lilishop.vn/upload/hinhthem/665323126820quanbetraidaydeokakishorttheutrang8size18t-1457.jpg\" /></p>\r\n\r\n<p><img alt=\"\" src=\"http://lilishop.vn/upload/hinhthem/637513968598quanbetraidaydeokakishorttheuxanhket8size18t-1086.jpg\" /></p>\r\n\r\n<p><img alt=\"\" src=\"http://lilishop.vn/upload/hinhthem/271115405161quanbetraidaydeokakishorttheutrangkem8size18t-6291.jpg\" /></p>\r\n', 25, 1, 1, 1, 'Quần kaki kèm dây đeo', 'Quần kaki lai lật kèm dây đeo', 'Quần kaki thêu oto kèm dây đeo cá tính cho bé trai với chất vải kaki mềm.', 'sanpham', ''),
(109, 1, 0, 0, '208678600831-quan-dai-ni-be-trai-cute-theu-gau-cam-8size-18t-8457.png', '208678600831-quan-dai-ni-be-trai-cute-theu-gau-cam-8size-18t6797_215x275.png', '208678600831-quan-dai-ni-be-trai-cute-theu-gau-cam-8size-18t8287_415x530.png', '', 'Quần thun da cá mông thêu thú đáng yêu', 'quan-thun-da-ca-mong-theu-thu-dang-yeu', 'Liên hệ: 0938.947.566\r\nQuần chất liệu da cá cotton thoáng mát, với thiết kế mông thêu mặt thú ngộ nghĩnh đáng yêu. \r\n', '1707045', 90000, 0, '<p>Hãy đến với Lilishop , tại đây luôn cập nhật nhiều mẫu mã thời trang cho các bé yêu nhà mình ah! Lilishop cho ra mắt quần thun da cá bé trai kết hợp thêu hình thú ngộ nghĩnh đáng yêu sau mông, chỉ cần tưởng tượng bé nhà mình mặc chiếc quần này lên thôi, ôi!! đáng yêu quá đi mất. Với chất thun da cá thoáng mát nhưng cũng đủ để giữ ấm cho bé trong thời tiết se lạnh.</p>\r\n\r\n<p>Sản phẩm dành cho các bé từ 10kg đến 25kg mặc vừa. Liên hệ 0938.947.566 để được tư vấn rõ hơn nhé!</p>\r\n\r\n<p><img alt=\"NO PHOTO\" src=\"http://lilishop.vn/upload/sanpham/208678600831-quan-dai-ni-be-trai-cute-theu-gau-cam-8size-18t-8457.png\" /></p>\r\n', 18, 1, 1, 1, 'Quần thun mông thêu thú', 'Quần thun da cá mông thêu thú', 'Quần thun da cá mông thêu thú ngộ nghĩnh, đáng yêu với chất da cá cotton thoáng mát, thấm hút mồ hôi.', 'sanpham', '');
