(110, 1, 0, 0, '540429480614-ao-ba-lo-be-trai-he-likids-da-do-do-7size-28t-5420.png', '540429480614-ao-ba-lo-be-trai-he-likids-da-do-do-7size-28t7114_215x275.png', '540429480614-ao-ba-lo-be-trai-he-likids-da-do-do-7size-28t3356_415x530.png', '', 'Áo ba lỗ bé trai / bé gái may túi da', 'ao-ba-lo-be-trai-be-gai-may-tui-da', 'Size: 2_5t giá 60k<br />\r\nSize: 6_8t giá 65k<br />\r\nÁo ba lỗ với chất vải thun cotton thoáng mát, thấm hút mồ hôi cực tốt cho bé tha hồ mà vận động.', '1707044', 60000, 0, '', 38, 1, 1, 1, 'Áo ba lỗ bé trai ', 'Áo ba lỗ bé trai / bé gái', 'Áo ba lỗ bé  trai phối túi da với chất vải cotton 4 chiều thấm hút mồ hôi, thoáng mát', 'sanpham', ''),
(111, 1, 0, 0, '720426642638-ao-so-mi-be-trai-kate-he-2017-ngan-tay-do-8size-18t-4475.jpg', '720426642638-ao-so-mi-be-trai-kate-he-2017-ngan-tay-do-8size-18t4221_215x275.jpg', '720426642638-ao-so-mi-be-trai-kate-he-2017-ngan-tay-do-8size-18t8420_415x530.jpg', '', 'Áo sơ mi bé trai hai túi hộp trước ngực thêu biểu tượng polo', 'ao-so-mi-be-trai-hai-tui-hop-truoc-nguc-theu-bieu-tuong-polo', 'Size: 1_4t  giá  95000<br />\r\nSize: 5_8t  giá  103000<br />\r\nÁo sơ mi bé trai chất kate cotton mềm, mát với thiết kế hai túi hộp trước ngực xinh xắn, sang trọng.', '1707043', 95000, 0, '', 49, 1, 1, 1, 'Áo sơ mi bé trai ', 'Áo sơ mi bé trai hai túi hộp', 'Áo sơ mi bé trai phối hai túi hộp trước ngực đáng yêu, với chất liệu kate cotton mềm, mát cho bé yêu nhà bạn thoải mái diện kèm với quần jean rất sang trọng và đáng yêu .', 'sanpham', ''),
(112, 1, 0, 0, '269760922994-ao-be-gai-tre-vai-nhi-xo-gan-hong-6size-16t-0806.png', '269760922994-ao-be-gai-tre-vai-nhi-xo-gan-hong-6size-16t0110_215x275.png', '269760922994-ao-be-gai-tre-vai-nhi-xo-gan-hong-6size-16t7713_415x530.png', '', 'Áo bé gái kiểu rớt vai đáng yêu', 'ao-be-gai-kieu-rot-vai-dang-yeu', 'Size:  1_6t  giá  85000<br />\r\nSize:  7_12t  giá  97000<br />\r\nÁo với chất vải xô gân mềm, mát kết hợp với thiết kế rớt vai xinh xắn. Áo có thể kết hợp với quần short hoặc dài jean, kaki đều rất hợp.', '1707048', 85000, 0, '', 24, 1, 1, 1, 'Áo kiểu bé gái', 'Áo lẻ kiểu rớt vai cho bé gái', 'Áo bé gái với kiểu rớt vai xinh xắn, đáng yêu. Sản phẩm với chất liệu xô gân mềm và cực mát tạo cảm giác thoải mai cho bé sử dụng', 'sanpham', ''),
(113, 1, 0, 0, '710041437815-do-bo-be-gai-soc-no-cotton-thu-hong-sen-8size-310t-3257.png', '710041437815-do-bo-be-gai-soc-no-cotton-thu-hong-sen-8size-310t5953_215x275.png', '710041437815-do-bo-be-gai-soc-no-cotton-thu-hong-sen-8size-310t2536_415x530.png', '', 'Đồ bộ bé gái in sọc phối nơ xinh xắn cho bé', 'do-bo-be-gai-in-soc-phoi-no-xinh-xan-cho-be', 'Size: 3_6t giá  128k<br />\r\nSize: 7_10t giá  135k<br />\r\nThiết kế với áo in sọc phối 2 túi kết hợp quần lững dài qua gối gắn nơ xinh xắn, đáng yêu. Sản phẩm với chất liệu thun cotton 4 chiều co giãn thoải mãi và thấm hút mồ hôi cực tốt.', 'ĐBBG 170753', 128000, 0, '', 16, 1, 1, 1, 'Thời trang bé gái hè 2018', 'Đồ bộ bé gái quần lững gắn nơ', 'Bộ bé gái quần lững gắn nơ, áo in sọc độc đáo phối 2 túi gắn nơ xinh xắn cho bé từ 15kg - 33kg', 'sanpham', ''),
(114, 1, 0, 0, '295073681535-ao-co-tru-be-gai-cotton-in-meo-in-kitty-dai-hong-phan-5size-913t-4122.png', '295073681535-ao-co-tru-be-gai-cotton-in-meo-in-kitty-dai-hong-phan-5size-913t9425_215x275.png', '295073681535-ao-co-tru-be-gai-cotton-in-meo-in-kitty-dai-hong-phan-5size-913t7060_415x530.png', '', 'Áo cổ trụ bé gái in mèo kitty', 'ao-co-tru-be-gai-in-meo-kitty', 'Size: 1_8t  giá  90000<br />\r\nSize: 9_13t  giá 105000<br />\r\nÁo với chất liệu thun cotton mềm, mát dành cho bé từ 8 kg đến 34kg. với thiết kế áo cổ trụ in mèo kitty xinh xắn đáng yêu.', 'ABG 170754', 90000, 0, '', 18, 1, 1, 1, 'Áo bé gái in mèo kitty ', 'Áo cổ trụ bé gái in mèo kitty', 'Áo bé gái in mèo kitty cổ trụ thun cotton 4 chiều thoáng mát, dành cho bé từ 8kg - 34kg', 'sanpham', ''),
(115, 1, 0, 0, '500736578869-ao-so-mi-be-gai-theu-mat-cuoi-trung-xanh-ngoc-5size-610t-4084.png', '500736578869-ao-so-mi-be-gai-theu-mat-cuoi-trung-xanh-ngoc-5size-610t7685_215x275.png', '500736578869-ao-so-mi-be-gai-theu-mat-cuoi-trung-xanh-ngoc-5size-610t6332_415x530.png', '', 'Áo sơ mi dài tay bé trai / bé gái thêu mặt cười', 'ao-so-mi-dai-tay-be-trai-be-gai-theu-mat-cuoi', 'Size: 1_5t   giá  95000<br />\r\nSize: 6_10t giá  105000<br />\r\nÁo sơ mi dài tay với chất vải xô gân, mềm mát dành cho cả bé trai lẫn bé gái đều mặc được với hình thêu mặt cười ngộ nghĩnh, đáng yêu', 'ABG 170755', 95000, 0, '', 7, 1, 1, 1, 'áo sơ mi dài tay bé gái thêu mặt cười', 'Áo sơ mi dài tay bé trai/ bé gái', 'Áo sơ mi với chất liệu xô gân mềm, mát với hình thêu mặt cười ngộ nghĩnh đáng yêu', 'sanpham', ''),
(116, 1, 0, 0, '005360620355-ao-be-gai-tre-vai-cotton-theu-dai-hong-sen-5size-812t-4921.jpg', '005360620355-ao-be-gai-tre-vai-cotton-theu-dai-hong-sen-5size-812t5326_215x275.jpg', '005360620355-ao-be-gai-tre-vai-cotton-theu-dai-hong-sen-5size-812t4047_415x530.jpg', '', 'Áo bé gái cổ tròn rớt vai xinh xắn ', 'ao-be-gai-co-tron-rot-vai-xinh-xan', 'Size: 1_7t  giá  75000<br />\r\nSize: 8_12t giá 85000<br />\r\nÁo cổ tròn kết hợp kiểu rớt vai đáng yêu với chất liệu thun cotton mềm thấm hút mồ hôi cực tốt, cho bé yêu nhà bạn thoải mái vận động với hình thêu chú chim ngộ nghĩnh đúng lứa tuổi các con. ', 'ABG 170756', 75000, 0, '', 10, 1, 1, 1, 'Áo thun bé gái cổ tròn', 'Áo be gái rớt vai cổ tròn', 'Áo bé gái với chất liệu thun cotton thoáng mát kết hợp kiểu rớt vai đáng yêu', 'sanpham', ''),
(117, 1, 0, 0, '387484905753-ao-so-mi-be-gai-buom-kate-cotton-xanh-den-8size-18t-2779.png', '387484905753-ao-so-mi-be-gai-buom-kate-cotton-xanh-den-8size-18t5185_215x275.png', '387484905753-ao-so-mi-be-gai-buom-kate-cotton-xanh-den-8size-18t5438_415x530.png', '', 'Áo kate hoa văn sát nách cho bé gái phối túi đáng yêu', 'ao-kate-hoa-van-sat-nach-cho-be-gai-phoi-tui-dang-yeu', 'Size: 1_4t  giá  85000<br />\r\nSize: 5_8t  giá  90000<br />\r\nÁo kate hoa văn cho bé yêu kết hợp với quần short jean, kate rất đáng yêu và năng động.', 'ABG 170757', 85000, 0, '', 15, 1, 1, 1, 'Áo kiểu kate cho bé gái', 'Áo kate kiểu cho bé gái', 'Áo sát nách vải hoa với chất liệu kate cotton phối túi cho bé gái mùa hè năng động', 'sanpham', ''),
(118, 1, 0, 0, '293985646634-ao-be-trai-co-trai-tim-theu-likids-xanh-chuoi-8size-18t-4182.png', '293985646634-ao-be-trai-co-trai-tim-theu-likids-xanh-chuoi-8size-18t3120_215x275.png', '293985646634-ao-be-trai-co-trai-tim-theu-likids-xanh-chuoi-8size-18t1002_415x530.png', '', 'Áo bé trai cổ trái tim thêu chữ likids', 'ao-be-trai-co-trai-tim-theu-chu-likids', 'Size: 1_4t  giá  75000<br />\r\nSize: 5_8t  giá  80000<br />\r\nÁo bé trai cổ trái tim đơn giản nhưng cá tính và sang trọng dành cho bé trai từ 10kg - 25kg, sản phẩm với chất liệu thun cotton thoáng mát.', 'ABT 170758', 75000, 0, '', 12, 1, 1, 1, 'ÁO CỔ TRÁI TIM CHO BÉ TRAI', 'Áo bé trai cổ trái tim body', 'Áo bé trai thêu chữ likids với cổ áo hình trái tim cá tính cho bé trai với chất liệu thun cotton thoáng mát, thấm hút mồ hôi cực tốt cho bé yêu thoải mái vận động.', 'sanpham', ''),
(119, 1, 0, 0, '435144245916-ao-be-trai-polo-phoi-jean-vang-nhi-8size-18t-3290.png', '435144245916-ao-be-trai-polo-phoi-jean-vang-nhi-8size-18t5168_215x275.png', '435144245916-ao-be-trai-polo-phoi-jean-vang-nhi-8size-18t3163_415x530.png', '', 'Áo polo phối cổ,  túi áo cho bé trai', 'ao-polo-phoi-co-tui-ao-cho-be-trai', 'Size:  1_4t  giá  85000<br />\r\nSize: 5_7t   giá  90000<br />\r\nÁo bé trai polo với chất da cá mềm, sản phẩm in neo toàn thân đáng yêu cho bé.', 'ABT 170759', 85000, 0, '', 28, 1, 1, 1, 'Áo polo bé trai', 'Áo polo phối cổ và túi cho bé trai', 'Áo polo cho bé với chất liệu da cá mềm, sản phẩm được phối cổ, túi áo với chất jean mềm thể hiện sự cá tính cho bé.', 'sanpham', ''),
